import axios from 'axios';


class AdminService {

    getUsers( baseUrl){
        axios.get(baseUrl).then(response => {
            console.log(response.data);
            this.setState({ data: response.data });
        }).catch(error => {
            console.log(error.message);
        })

    }
}

export default  new AdminService();
